import React, {useState} from 'react'
import { Link, RouteComponentProps } from 'react-router-dom';
import MyoptionGroup from '../src/MyoptionGrop';
import DefaultGroup from '../src/DefaultGroup';
import logo from '../src/logo.png';

type Props = RouteComponentProps;

const header:React.FC<Props> = ({ history }) => {

  const [NowPage, setNowPage] = useState(true); //true면 defalultgroup, false면 myoptiongroup

  return (
    //로고
    // 어디 페이지인가에 따라서 <MyoptionGroup> : <DefaultGroup>
    // <LoginSection> => 로그인 상태에 따라서 <LoginBtn> : <MypageBtn>
    <div className="header-container">
      <div className="logo">
        <Link to="landing">
        <div className='header-logo-wrapper'>
          <img className='header-logo' alt="Logo" src={logo} />
        </div>
        </Link>
      </div>
      <div className="group">
        {NowPage? <DefaultGroup/> : <MyoptionGroup/> }
      </div>

    </div>
  )
}

export default header
